import React from "react";
import ReactDOM from "react-dom"


const DisplayInfo = (props) => {



    return (
        <ul>
            <p>Name</p>
            <li>{props.name}</li>
            <p>Phone</p>
            <li>{props.phone}</li>
            <p>Email</p>
            <li>{props.email}</li>
        </ul>
    );
};

export default DisplayInfo;
